function getPoisCYYQ(){
    for (var i = 0; i < 28; i++) {
        var page = i + 1;
        request(`https://restapi.amap.com/v3/place/text?key=c7aeb11746b35a92b7b6eee3178a05e4&keywords=&types=120100&city=210100&children=1&offset=20&page=${page}&extensions=all`, function (error, response, body) {
            var obj = JSON.parse(body);
            var pois = obj.pois;
            var ids = "";
            console.log(pois);

            pois.forEach(function(poi){
                ids += `{"poiId":"${poi.id}","poiLocation":"${poi.location}","poiName":"${poi.name}","poiType":"${poi.type}","poiAddress":"${poi.address}","poiBounds":"null"},`;
            })
            fs.appendFile("./poisCYYQ.txt", ids, (error)=> {
                if (error) return console.log("追加文件失败" + error.message);
                console.log("追加成功");
            });
        });
    }
}


function getPoisCYYQBounds(){

    for (var i = 500; i < 550 ; i++){
        //console.log(`https://ditu.amap.com/detail/${poisHousing[i].poiId}/?src=mypage&callnative=0`);
        request(`https://ditu.amap.com/detail/${poisCYYQ[i].poiId}/?src=mypage&callnative=0`, function (error, response, body) {
            // console.log(poi.poiId);
            // console.log(body);

            if (body !== undefined){
                if (body.indexOf(`"shape":"`) !== -1){
                    // console.log(poi.poiId);
                    // console.log(body);
                    var path = [];
                    var start = body.indexOf(`"shape":"`)+9;
                    var end = "";
                    if (body.indexOf(`","parentid"`) !== -1){
                        end = body.indexOf(`","parentid"`);
                    } else {
                        end = body.indexOf(`","level"`);
                    }
                    var start2 = body.indexOf(`"poiid":"`)+9;
                    var end2 = body.indexOf(`","tag"`);
                    var poiId = body.slice(start2,end2);

                    // var end = body.indexOf(`","level"`);
                    // console.log(body.slice(start,end));
                    // console.log('*************************');
                    body.slice(start,end).split(";").forEach(function(pointW){
                        var point = pointW.split(",");
                        var long = Number(point[0]);
                        var lat = Number(point[1]);
                        path.push([long,lat]);
                    });

                    //poisHousing1to300[i]["poiBounds"] = JSON.stringify(path);
                    // poisHousing[i]["poiBounds"] = JSON.stringify(path);
                    path = JSON.stringify(path);
                    fs.appendFile("./poisCYYQBounds.txt", `{"poiId":"${poiId}","poiBounds":"${path}"},`, (error)=> {
                        if (error) return console.log("追加文件失败" + error.message);
                        console.log("追加成功");
                    });
                }
            }
        });
    }
}


function getPoisCYYQFinal(){
    poisCYYQBounds.forEach(function(bound){
        for (var i = 0; i < poisCYYQ.length; i++){
            if (poisCYYQ[i].poiId === bound.poiId){
                poisCYYQ[i].poiBounds = bound.poiBounds;
                break;
            }
        }
    });
    fs.appendFile("./poisCYYQF.txt", JSON.stringify(poisCYYQ), (error)=> {
        if (error) return console.log("追加文件失败" + error.message);
        console.log("追加成功");
    });
}

